  true,\n\t\"url\": null,\n\t\"notes\": \"The reports provided as part of this tool
  present information and varied looks at trends related to pipeline incidents over
  the past 20 years. Information includes: serious incidents (involving a fatality
  or injury requiring in-patient hospitalization), significant incidents (meet a number
  of predefined conditions, including inflation adjusted value of property damage,
  minimum threshold for volume spilled for hazardous liquid, fire and explosion for
  hazardous liquid), reported incidents (all pipeline incidents reported to PHMSA
  in accordance with reporting criterion which has changed over time), consequences
  (effects on both the general public and the pipeline industry), and state-based
  reports.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
